import React, { useState } from 'react'

import Navbar from './Navbar';
import Cards from './Cards';



function App() {
  const [man , setman] = useState(Cards);
  const ghadi = () =>{
       setman(man.filter(()=>{
         return man.what !== "Movie";
       }))
  }
  return (<>
    <h1 className = "tittle">Hello I am Harsh Bhatnagar</h1>
    <div className = "WholeSection">
    <div className = "leftmenu">
      <button onClick = {ghadi}>Movies</button>

    </div>
    <div className = "cards">
    {Cards.map((val,index)=>{
      return(
        <Navbar
          key = {index}
          images = {val.link}
          title = {val.title}
          date = {val.Date}
          btao = {val.what}
        />
      )
    })}

    </div>
    </div>
    </>
  );
}

export default App;
